# -*- coding: utf-8 -*-
gettext("""The EOMF is part of a multi-institution team that received US$9.6 million from the USDA for an interdisciplinary project “Resilience and vulnerability of beef cattle production in the Southern Great Plains under changing climate, land use and markets” (2/15/2013 – 2/14/2018). Other partners of the project team include Oklahoma State University, Kansas State University, Texas Tarleton State University, the Samuel R. Noble Foundation, and two USDA ARS laboratories.""")
